import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import authService from "../../services/authService";

const Register = () => {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    first_name: "",
    last_name: "",
    email: "",
    mobile_number: "",
    password: "",
    confirmPassword: "",
  });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

const handleSubmit = async (e) => {
    e.preventDefault();

    if (form.password !== form.confirmPassword) {
      alert("❌ Mật khẩu không khớp!");
      return;
    }

    try {
      // ✅ Fix: Chuẩn hóa Payload giống hệt cấu trúc mobile đang chạy được
      const payload = {
        firstName: form.first_name,
        lastName: form.last_name,
        email: form.email,
        password: form.password,
        mobileNumber: form.mobile_number,
        address: {
          street: "Default Street",
          buildingName: "Building A",
          city: "Hanoi",
          state: "HN",
          country: "VN",
          pincode: "100000",
        },
        role: [
          {
            roleId: 102, // Đảm bảo ID này khớp với role USER trong database của bạn
            roleName: "USER",
          },
        ],
      };

      console.log("SENDING PAYLOAD:", payload);

      const res = await authService.register(payload);

      alert("✅ Đăng ký thành công! Chào mừng " + form.first_name);
      navigate("/login");
    } catch (error) {
      // Log chi tiết lỗi từ Backend để debug
      const errorMsg = error.response?.data?.message || "Đăng ký thất bại, email có thể đã tồn tại!";
      console.error("REGISTER ERROR:", error.response?.data);
      alert("❌ Lỗi: " + errorMsg);
    }
  };

  return (
    <section className="section-content padding-y">
      <div
        className="card mx-auto shadow"
        style={{ maxWidth: "520px", marginTop: "40px" }}
      >
        <article className="card-body">
          <header className="mb-4 text-center">
            <h4 className="card-title">Sign up</h4>
          </header>

          <form onSubmit={handleSubmit}>
            {/* Tên */}
            <div className="form-row">
              <div className="col form-group">
                <label>First name</label>
                <input
                  name="first_name"
                  type="text"
                  className="form-control"
                  value={form.first_name}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="col form-group">
                <label>Last name</label>
                <input
                  name="last_name"
                  type="text"
                  className="form-control"
                  value={form.last_name}
                  onChange={handleChange}
                  required
                />
              </div>
            </div>

            {/* Email */}
            <div className="form-group">
              <label>Email</label>
              <input
                name="email"
                type="email"
                className="form-control"
                value={form.email}
                onChange={handleChange}
                required
              />
            </div>

            {/* Số điện thoại */}
            <div className="form-group">
              <label>Mobile number</label>
              <input
                name="mobile_number"
                type="text"
                className="form-control"
                value={form.mobile_number}
                onChange={handleChange}
              />
            </div>

            {/* Mật khẩu */}
            <div className="form-row">
              <div className="form-group col-md-6">
                <label>Password</label>
                <input
                  name="password"
                  type="password"
                  className="form-control"
                  value={form.password}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="form-group col-md-6">
                <label>Repeat password</label>
                <input
                  name="confirmPassword"
                  type="password"
                  className="form-control"
                  value={form.confirmPassword}
                  onChange={handleChange}
                  required
                />
              </div>
            </div>

            <button type="submit" className="btn btn-primary btn-block">
              Register
            </button>
          </form>
        </article>
      </div>

      <p className="text-center mt-4">
        Have an account? <Link to="/login">Log In</Link>
      </p>
    </section>
  );
};

export default Register;
